import './App.css';
import Home from './components/Home/Home'

function App() {

  const contentDivStyle = {
      minHeight: '100%',
      position: 'relative',
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center'
  }
  return (
    <div className='contentDivStyle'>
      <Home />
    </div>
  );
}

